import React, { useState, useEffect } from 'react';

const RoutesList = () => {
	const [routes, setRoutes] = useState();

	useEffect(() => {
		axios
		.get("http://webservices.nextbus.com/service/publicXMLFeed?command=routeList&a=ttc")
		.then(({ data }) => {
			setRoutes(data);
		});
	}, []);

	return (
		<div>Woow</div>
	)
};

export default RoutesList;
